import '../css/Signup.css';
function Signup()
{
  return (
    <div class="Signup  d-flex align-items-center">
      <div class="container d-flex justify-content-end align-items-center ">
        <div class="form-sign-up col-4 me-5 w-25 border p-3 rounded rounded-3 bg-info bg-gradient shadow-lg">
          <h1 class="text-center mb-5">Register</h1>
          <input type="text" class="form-control mb-4 rounded-pill" placeholder="Your name" />
          <input type="text" class="form-control mb-4 rounded-pill" placeholder="Your email" />
          <input type="text" class="form-control mb-4 rounded-pill" placeholder="Your phone number" />
          <input type="password" class="form-control mb-4 rounded-pill" placeholder="You(8 - 12 kí tự)" />
          <input type="password" class="form-control mb-4 rounded-pill" placeholder="" />
          <button type="button" class="btn btn-primary rounded-pill w-100 my-4">Submit</button>
          <div class="text-center">Already have an account? <a href="https://www.facebook.com/">Sign in</a></div>

        </div>
      </div>
    </div>
  );
}

export default Signup;
